  const [data, setData] = useState([]);
  const fetchData = () => {
    axios
      .get("https://api.spacexdata.com/v4/payloads")
      .then((res) => {
        console.log(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  };
  useEffect(() => {
    fetchData();
  }, []);
  return (
    <div className="container">
      <div className="row">
        {data.map((data) => {
          <PayloadsItems
          customers = {data.customers}
          name={data.name}
          mass = {data.mass_kg} />;
        })}
      </div>
    </div>
  );
};

export default Payload;
